SELECT COUNT(*) as agg_0, SUM("client"."client_id") as agg_1, MIN("client"."client_id") as agg_2 FROM "client" LEFT OUTER JOIN "probehnuto" ON "client"."client_id" = "probehnuto"."client_id"  WHERE "probehnuto"."kc_proklikano" >= 441.2409730483038 AND "client"."kraj" IN ('Moravskoslezský kraj', 'Olomoucký kraj', 'Plzeňský kraj', 'Zlínský kraj', 'Praha', 'Jihomoravský kraj', 'Ústecký kraj', 'Středočeský kraj', 'Jihočeský kraj') AND "client"."client_id" >= 86757